import { StrictMode } from "react";
import { createRoot } from "react-dom/client";
import { BrowserRouter } from "react-router-dom";

import App from "./App";
import { AppProductProvider } from "./store/productContext";
import { AppCardProvider } from "./store/cartContext";
import {MainContext} from "./todo-context/index-context";

const rootElement = document.getElementById("root");
const root = createRoot(rootElement);

root.render(
  <StrictMode>
    <BrowserRouter>
    <MainContext>
    <AppCardProvider>
    <AppProductProvider>
    <App />
    </AppProductProvider>
    </AppCardProvider>
    </MainContext>
    </BrowserRouter>
  </StrictMode>
);
